import React from 'react';
import Square from './Square';
import './Row.css';

function Row(props) {
    return (
        <div className="Row">
            {props.squares.map((square, id) => <Square key={id} color={square === 1 ? 'white' : 'black'} />)}
        </div>
    );
}

export default Row;
